import React from 'react'

function CarritoCards(props) {
    return (
        <div>
            {
                props.basket.length >0 ? 
                   props.basket.map(item => {
                       return  Object.keys(item).map(itemKey =>{
                           return [...Array(item[itemKey])].map(key =>{
                             console.log(itemKey, key)
                            if(key.toString() === '[object Object]'){
                                console.log(key)
                                return Object.values(key).map( value => <span>{value.toFixed(2)}m.</span> )
                            }
                            if(key === ''){return null};
                           return <span><p>{itemKey}:{key}</p></span>
                           })
                           })
                    })
                 :<p style={{fontSize: '0.8rem'}}>No tiene productos cargados al carrito.</p>
            }
        </div>
    )
}

export default CarritoCards
